import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./Nav.css";
const logo = {
  id: "https://art.pixilart.com/7e3057713456a9d.png",
};
class Nav extends Component {
  state = {};

  render() {
    return (
      <div>
        <nav>
          <img src={logo.id} class="logo"></img>
          <li className="">Apexer</li>
          <Link to="/">
            <li>
              <a>Home</a>
            </li>
          </Link>

          <Link to="/Tracker">
            <li>
              <a>Tracker</a>
            </li>
          </Link>

          <Link to="/Rank">
            <li>
              <a>Rank</a>
            </li>
          </Link>

          <Link to="/About">
            <li>
              <a>About</a>
            </li>
          </Link>
        </nav>
      </div>
    );
  }
}

export default Nav;
